exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalog(`https://www.lusidm.com/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/class="info-chapters [^>]+>/,/<\/div>/,-1),recordRegex:hrefRecordRegex},{...options,clientOptions})};